import React from 'react'
// import Layout from '../Components/Layout'

const Home = () => {
    return (
        <>
            <div className='r1 my-3'>
                <h1
                    style={{
                        marginLeft: '2%',
                        fontFamily: 'cursive',
                    }}
                >
                    Suggested for you
                </h1>
                <button
                    className='chicken'
                    style={{ backgroundImage: 'C:UsersdharmilDesktopReactProjectsImagesChicken.webp' }}
                ></button>
            </div>
        </>
    )
}

export default Home
